import React, { useState, useEffect } from 'react';
import { useLocation, useParams, useNavigate } from 'react-router-dom';
import { ethers } from 'ethers';
import { Chart as ChartJS, ArcElement, Tooltip, Legend } from 'chart.js';
import { Pie } from 'react-chartjs-2';
import { abi } from './abi';
import { tokenAbi } from './tokenAbi';

ChartJS.register(ArcElement, Tooltip, Legend);

const TokenDetail = () => {
  // Keep all your existing state and hooks
  const { tokenAddress } = useParams();
  const location = useLocation();
  const { card } = location.state || {};
  const navigate = useNavigate();

  const [owners, setOwners] = useState([]);
  const [transfers, setTransfers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [totalSupply, setTotalSupply] = useState('0');
  const [remainingTokens, setRemainingTokens] = useState('0');
  const [purchaseAmount, setPurchaseAmount] = useState('');
  const [cost, setCost] = useState('0');
  const [isModalOpen, setIsModalOpen] = useState(false);

  // Keep your existing tokenDetails object
  const tokenDetails = card || {
    name: 'Unknown',
    symbol: 'Unknown',
    description: 'No description available',
    tokenImageUrl: 'https://via.placeholder.com/200',
    fundingRaised: '0 ETH',
    creatorAddress: '0x0000000000000000000000000000000000000000',
  };

  // Keep all your existing constants and calculations
  const fundingRaised = parseFloat(tokenDetails.fundingRaised.replace(' ETH', ''));
  const fundingGoal = 24;
  const maxSupply = parseInt(800000);
  const fundingRaisedPercentage = (fundingRaised / fundingGoal) * 100;
  const totalSupplyPercentage = ((parseFloat(totalSupply) - 200000) / (maxSupply - 200000)) * 100;

  // Keep your existing useEffects and functions
  // ... (all your existing code for data fetching, chart setup, and handlers)

  return (
    <div className="min-h-screen bg-gradient-to-b from-yellow-300 to-yellow-400 text-gray-800">
      {/* Navigation */}
      <nav className="sticky top-0 z-50 bg-orange-400 shadow-lg">
        <div className="container mx-auto px-6 py-4">
          <div className="flex items-center justify-between">
            <button
              onClick={() => navigate(-1)}
              className="flex items-center gap-2 text-white hover:text-yellow-200 font-bold px-4 py-2 rounded-full bg-purple-600 hover:bg-purple-500 transform hover:scale-105 transition-all"
            >
              ← Back
            </button>
            <div className="text-2xl font-extrabold text-white">
              Token Details 🎭
            </div>
          </div>
        </div>
      </nav>

      <div className="max-w-6xl mx-auto px-6 py-8">
        <div className="grid grid-cols-1 lg:grid-cols-2 gap-8">
          {/* Left Column */}
          <div className="bg-white rounded-3xl p-6 shadow-xl transform hover:rotate-1 transition-all">
            <div className="flex items-center gap-4 mb-6">
              <span className="text-5xl">🎭</span>
              <h2 className="text-3xl font-extrabold text-purple-600">
                {tokenDetails.name}
              </h2>
            </div>

            {tokenDetails.tokenImageUrl && (
              <div className="mb-6 rounded-2xl overflow-hidden bg-gradient-to-br from-purple-100 to-pink-100 p-4">
                <img 
                  src={tokenDetails.tokenImageUrl} 
                  alt={tokenDetails.name} 
                  className="w-full max-w-[240px] h-[240px] object-contain mx-auto rounded-xl transform hover:scale-105 transition-all"
                />
              </div>
            )}

            <div className="space-y-4">
              <div className="bg-purple-50 rounded-xl p-4 transform hover:-rotate-1 transition-all">
                <p className="text-purple-600 font-bold mb-2">Creator Address:</p>
                <p className="font-mono text-sm break-all">{tokenDetails.creatorAddress}</p>
              </div>

              <div className="bg-purple-50 rounded-xl p-4 transform hover:rotate-1 transition-all">
                <p className="text-purple-600 font-bold mb-2">Token Address:</p>
                <p className="font-mono text-sm break-all">{tokenAddress}</p>
              </div>

              <div className="grid grid-cols-2 gap-4">
                <div className="bg-purple-50 rounded-xl p-4 text-center transform hover:-rotate-2 transition-all">
                  <p className="text-purple-600 font-bold mb-2">Funding Raised</p>
                  <p className="text-2xl font-extrabold text-orange-500">{tokenDetails.fundingRaised}</p>
                </div>

                <div className="bg-purple-50 rounded-xl p-4 text-center transform hover:rotate-2 transition-all">
                  <p className="text-purple-600 font-bold mb-2">Token Symbol</p>
                  <p className="text-2xl font-extrabold text-orange-500">{tokenDetails.symbol}</p>
                </div>
              </div>
            </div>
          </div>

          {/* Right Column */}
          <div className="space-y-6">
            {/* Progress Bars */}
            <div className="bg-white rounded-3xl p-6 shadow-xl transform hover:-rotate-1 transition-all">
              <div className="space-y-6">
                <div>
                  <div className="flex justify-between mb-3">
                    <span className="text-purple-600 font-bold">Bonding Curve Progress</span>
                    <span className="font-bold">{fundingRaised} / {fundingGoal} ETH</span>
                  </div>
                  <div className="h-6 bg-purple-100 rounded-full overflow-hidden">
                    <div 
                      className="h-full bg-gradient-to-r from-purple-500 to-pink-500 transition-all duration-500 rounded-full"
                      style={{ width: `${fundingRaisedPercentage}%` }}
                    ></div>
                  </div>
                </div>

                <div>
                  <div className="flex justify-between mb-3">
                    <span className="text-purple-600 font-bold">Remaining Tokens</span>
                    <span className="font-bold">{remainingTokens} / 800,000</span>
                  </div>
                  <div className="h-6 bg-purple-100 rounded-full overflow-hidden">
                    <div 
                      className="h-full bg-gradient-to-r from-purple-500 to-pink-500 transition-all duration-500 rounded-full"
                      style={{ width: `${totalSupplyPercentage}%` }}
                    ></div>
                  </div>
                </div>
              </div>
            </div>

            {/* Buy Tokens Section */}
            <div className="bg-white rounded-3xl p-6 shadow-xl transform hover:rotate-1 transition-all">
              <div className="flex items-center gap-4 mb-6">
                <span className="text-4xl">🚀</span>
                <h3 className="text-2xl font-extrabold text-purple-600">Buy Tokens</h3>
              </div>

              <div className="space-y-4">
                <input
                  type="number"
                  placeholder="Enter amount of tokens to buy"
                  value={purchaseAmount}
                  onChange={(e) => setPurchaseAmount(e.target.value)}
                  className="w-full px-6 py-4 rounded-xl bg-purple-50 border-2 border-purple-200 focus:border-purple-500 focus:ring-2 focus:ring-purple-500 focus:outline-none transition-all text-lg"
                />
                <button 
                  onClick={getCost}
                  className="w-full py-4 rounded-xl font-bold text-xl bg-orange-400 text-white hover:bg-orange-500 transform hover:scale-105 hover:rotate-1 transition-all"
                >
                  Purchase 🎯
                </button>
              </div>
            </div>
          </div>
        </div>

        {/* Charts and Tables Sections */}
        {/* ... Keep your existing chart and table sections, but update their styling */}
      </div>

      {/* Purchase Modal */}
      {isModalOpen && (
        <div className="fixed inset-0 bg-black/75 flex items-center justify-center p-4 z-50">
          <div className="bg-white rounded-3xl p-8 shadow-2xl max-w-md w-full transform hover:rotate-1 transition-all">
            <div className="flex items-center gap-4 mb-6">
              <span className="text-4xl">🎯</span>
              <h4 className="text-2xl font-extrabold text-purple-600">Confirm Purchase</h4>
            </div>
            <p className="text-xl mb-6">
              Cost of {purchaseAmount} tokens: 
              <span className="font-bold text-orange-500 ml-2">{cost} ETH</span>
            </p>
            <div className="flex gap-4">
              <button 
                onClick={handlePurchase}
                className="flex-1 py-3 rounded-xl font-bold text-white bg-purple-600 hover:bg-purple-500 transform hover:scale-105 transition-all"
              >
                Confirm 🚀
              </button>
              <button 
                onClick={() => setIsModalOpen(false)}
                className="flex-1 py-3 rounded-xl font-bold bg-gray-200 hover:bg-gray-300 transform hover:scale-105 transition-all"
              >
                Cancel ✖️
              </button>
            </div>
          </div>
        </div>
      )}

      {/* Background decorations */}
      <div className="fixed inset-0 pointer-events-none overflow-hidden -z-10">
        <div className="absolute top-0 left-0 w-full h-full bg-[repeating-linear-gradient(45deg,#FFD700,#FFD700_10px,#FFA500_10px,#FFA500_20px)] opacity-20" />
        {[...Array(10)].map((_, i) => (
          <div
            key={i}
            className="absolute animate-float text-4xl"
            style={{
              left: `${Math.random() * 100}%`,
              top: `${Math.random() * 100}%`,
              animationDelay: `${Math.random() * 5}s`,
              transform: `rotate(${Math.random() * 360}deg)`
            }}
          >
            {['🚀', '💎', '🌕', '🦍', '🎮'][Math.floor(Math.random() * 5)]}
          </div>
        ))}
      </div>
    </div>
  );
};

export default TokenDetail;
